One.onLoad(class {
    static initValidation() {
        One.helpers("jq-validation"), jQuery(".isyeri-adi-degistir").validate({
            rules: {
                "isyeri-adi": {
                    required: !0,
                    minlength: 5
                }
            },
            messages: {
                "isyeri-adi": {
                    required: "Koymak istediğin işyeri adını belirt.",
                    minlength: "İşyeri adınız en az 5 karakter olmak zorundadır."
                }
            }
        })
    }
    static init() {
        this.initValidation()
    }
}.init());